import React from 'react';

const Admin = ({children}) =>  {
	return (
		<div>
			<div class="sidebar">
  <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
</div>
			{children}
		</div>
	);
}

export default Admin;
